import React from "react";

import "./Home.css";

export default function Home() {
  return (
    <div className="Home">
      <hr />
      <section className="grid">
        <div>
          <h1>
            {" "}
            I'm Raghda Al-Shaikhli, a <br />
            Front-end Developer{" "}
          </h1>
        </div>
        <div>
          <img src="src/images/coding-pic.png" alt="coding languages" />
        </div>
      </section>
    </div>
  );
}
